Synopsis: The episode starts with Kapil, Dadi celebrating their win in a cricket match. Later, Dadi asks Kapil about Virat Kohli who was supposed to come to their house for an interview. Kapil calls up Virat Kohli but who does not answer the call, saying that he is busy. Dadi also tries calling up but does not get a reply. Virat comes to know that Dadi had called up and gets scared, and rushes to Kapil's house. Watch the episode and have a lots of fun with Virat and Kapil's crazy family.

